  false,\n\t\"url\": null,\n\t\"notes\": \"In 1974 and 1975, 62 baseline locations
  were selected for intensive study in the salt marshes of Port Valdez and vicinity.
  The sites are intended to reflect the impact of oil transport activities. Vegetation
  and soil characteristics were emphasized. The sites were selected as representative
  of a wide variety of major communities and were widely distributed over the region
  to enhance the likelihood of oil spill documentation. Seventeen community complexes
  were identified and correspondence was found between the community complexes and
  habitat characteristics.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
